import groovy.json.JsonSlurper

def flowFile = session.get()
if (flowFile == null) return

try {
    final String headersJson = flowFile.getAttribute('userSession.headers')
    if (headersJson == null || headersJson.isEmpty()) {
        session.transfer(flowFile, REL_SUCCESS)
        return
    }

    // Parse JSON efficiently with direct map creation
    final Map parsedHeaders = new JsonSlurper().parseText(headersJson)
    final Map<String, String> attributeMap = new HashMap<>(parsedHeaders.size())

    // Direct attribute mapping with type conversion
    parsedHeaders.each { k, v -> 
        attributeMap.put(k, (v == null) ? "" : v.toString())
    }

    // Batch update all attributes in one operation
    session.putAllAttributes(flowFile, attributeMap)
    session.transfer(flowFile, REL_SUCCESS)
} catch (Exception e) {
    // Minimal error handling for maximum performance
    session.transfer(flowFile, REL_FAILURE)
}
